import React, { Component } from 'react';
import axios from 'axios';
import { Container, Row, Col } from 'reactstrap';

const Lista = props => (
  <tr>
    <td>{props.lista.estado}</td>
    <td>{props.lista.cidade}</td>
    <td>{props.lista.data}</td>
    <td>{props.lista.casos_confirmados}</td>
    <td>{props.lista.mortes}</td>
    
  </tr>
)

export default class Lista_diaria extends Component {
  constructor(props) {
    super(props);

    this.state = {listas: []};
  }

  componentDidMount() {
    axios.get('http://localhost:5000/lista_diaria/')
      .then(response => {
        this.setState({ mapas: response.data })
      })
      .catch((error) => {
        console.log(error);
      })
  }

  
  lista_diaria() {
    return this.state.mapas.map(currentlista_diaria => {
      return <Lista mapa={currentlista_diaria} key={currentlista_diaria._id}/>;
    })
  }

  render() {
    return (
      <Container className="themed-container" fluid={true}>
        <Row>
        <Col>
        <h3>Lista De Casos Diarios</h3>
        <table className="table">
          <thead className="thead-light">
            <tr>
              <th>Estado</th>
              <th>Cidade</th>
              <th>Data</th>
              <th>Casos Confirmados</th>
              <th>Mortes</th>
            </tr>
          </thead>
          <tbody>
            { this.lista_diaria() }
          </tbody>
        </table>
        </Col>
        </Row>
      </Container>
    )
  }
}
